const W3CWebSocket = require('websocket').w3cwebsocket;
const EventEmitter = require('events');
class ConferenceServer {
    client;
    ee = new EventEmitter();
    constructor(url, origin) {
        // this.client = new W3CWebSocket(url, 'echo-protocol');
        this.client = new W3CWebSocket(url, null);
        const instance = this.constructor.instance;
        if (instance) {
            return instance;
        }
        this.constructor.instance = this;
    }
    connect() {
        return new Promise((resolve, reject) => {
            this.client.onerror = function () {
                console.log(" ->>> onerror")
               reject('Connection Error');
            };
            this.client.onopen = () => {
                console.log('WebSocket Client Connected');
                if (this.client.readyState === this.client.OPEN) {
                    actionListener(this.client, this.ee);
                    resolve(this.ee);
                }
            }
            this.client.onclose = (event) => {
              window.location.reload();
            };
        })
    }
 
    async sendCommand(data){
      this.client.send(data)
    }
    
    emitCommand(data){
      if (typeof data === 'string') {
        const response = JSON.parse(data);
        const { Event } = response;
        console.log('Received Event: ', Event);
        console.log("Received Data: '" + data + "'");
        this.ee.emit(Event, response)
      }
    }
    
    listenerRemove(eventName){
      this.ee.removeAllListeners(eventName);
    }
}




const actionListener = (connection, ee) => {
    connection.onmessage = function (e) {
        if (typeof e.data === 'string') {
          const response = JSON.parse(e.data);
          const { Event } = response;
          console.log('Received Event: ', Event);
          console.log("Received Data: '" + e.data + "'");
            ee.emit(Event, response)
        }
    };
}

window.conference = ConferenceServer;

